import React from "react";
import { useNavigate } from "react-router-dom";

export default function Navbar() {
  const navigate = useNavigate();

  return (
    <div className="navbar">
<nav>
  <Link to="/">Home</Link>
  <Link to="/adopt">Adopt</Link>
  <Link to="/shop">Shop</Link>
</nav>
    </div>
  );
}
